- input: "TEXT\x1CC00445452\x1CX0\x1C\x1CF3A\x1CThis amendment is in response to the
    Commission's letter dated December 30, 2008.  The contributions from Terese Colling
    and Sam Simon were inadvertently disclosed twice on the Committee's Post-General
    Report.  The single contribution from these individuals was reported on a 48-hour
    notice on October 29, 2008, and October 24, 2008, respectively.  The Committee's
    Post-General report has been amended to reflect this change. The contribution
    from the Democratic Congressional Campaign Committee was actually a receipt of
    18 contributions for $100 each that were earmarked through the DCCC for the Committee.
    \ The Committee's Post-General report has been amended to reflect this change.
    The contributions from Bernard Fagelson and Carl Jones were actually received
    by the Committee on October 15, 2008, and should have appeared on the Committee's
    Pre-General report, thus not requiring a 48-hour notice.  The Pre-General report
    has been amended to reflect this change. The committee regrets that the lone remaining
    48-hour report was inadvertently overlooked, and has accordingly amended the campaign
    report. It is believed that all of the issues raised have been addressed with
    amendments. "
